import { Button } from "@mui/material";
import { title } from "process";
import { FC } from "react";

interface Props{
    text:string    
    backgroundColor:string,
    borderRadius:number,
    color:string,
    flex:number,
    hover:string
}

const MyButton:FC<Props> = ({text,backgroundColor,borderRadius,color,flex,hover}) =>{
    return (
        <Button
            sx={{
                backgroundColor: {backgroundColor},    // Color de fondo inicial
                borderRadius:{borderRadius},
                color:{color},
                flex:{},
                '&:hover': {
                backgroundColor: '#e0e0e0',  // Color de fondo al hacer hover
                },                
            }}
        >
            {text}
        </Button>
    );
}

export default MyButton
